        //search by actividad
        if ((this.searchByActividadID != 0) && (this.searchByMonitorID == 0)) {
            for (let slot of this.slots) {
                if (slot.actividad.id == this.searchByActividadID) {
                    this.searchResults.push(slot);
                }
            }
        }
        //search by monitor
